CREATE FUNCTION public.check_pet_cliente_tenant() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
            BEGIN
                IF EXISTS (
                    SELECT 1 FROM clientes c
                    WHERE c.id = NEW.cliente_id
                    AND c.tenant_id <> NEW.tenant_id
                ) THEN
                    RAISE EXCEPTION 'Tenant mismatch: pet x cliente';
                END IF;
                RETURN NEW;
            END;
            $$;


