--
-- Name: cliente_timeline; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.cliente_timeline AS
 SELECT 'venda'::text AS tipo_evento,
    id AS evento_id,
    cliente_id,
    NULL::integer AS pet_id,
    created_at AS data_evento,
    concat('Venda #', id) AS titulo,
    concat('Total: R$ ', round((total)::numeric, 2)) AS descricao,
        CASE
            WHEN (cancelada_por IS NOT NULL) THEN 'cancelado'::text
            ELSE 'concluido'::text
        END AS status,
        CASE
            WHEN (cancelada_por IS NOT NULL) THEN 'red'::text
            ELSE 'green'::text
        END AS cor_badge
   FROM public.vendas v
  WHERE (cliente_id IS NOT NULL);


