--
-- Name: fornecedor_timeline; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.fornecedor_timeline AS
 SELECT 'pedido_compra'::text AS tipo_evento,
    id AS evento_id,
    fornecedor_id,
    created_at AS data_evento,
    concat('Pedido #', id) AS titulo,
    'Pedido de compra'::text AS descricao,
    COALESCE(status, 'pendente'::character varying) AS status,
        CASE
            WHEN ((status)::text = 'recebido'::text) THEN 'green'::text
            WHEN ((status)::text = 'cancelado'::text) THEN 'red'::text
            ELSE 'yellow'::text
        END AS cor_badge
   FROM public.pedidos_compra pc
  WHERE (fornecedor_id IS NOT NULL);


ALTER VIEW public.fornecedor_timeline OWNER TO postgres;

