--
-- Name: vw_produtos_evolucao; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vw_produtos_evolucao AS
 SELECT p.id,
    p.nome,
    p.codigo,
    p.ativo,
    p.produto_predecessor_id,
    predecessor.nome AS predecessor_nome,
    predecessor.codigo AS predecessor_codigo,
    predecessor.data_descontinuacao AS predecessor_data_desc,
    p.data_descontinuacao,
    p.motivo_descontinuacao,
    sucessor.id AS sucessor_id,
    sucessor.nome AS sucessor_nome,
    sucessor.codigo AS sucessor_codigo,
        CASE
            WHEN ((p.data_descontinuacao IS NOT NULL) AND (sucessor.id IS NOT NULL)) THEN 'DESCONTINUADO'::text
            WHEN ((p.produto_predecessor_id IS NOT NULL) AND (p.data_descontinuacao IS NULL)) THEN 'SUCESSOR'::text
            WHEN ((p.produto_predecessor_id IS NULL) AND (p.data_descontinuacao IS NULL)) THEN 'NORMAL'::text
            ELSE 'DESCONTINUADO_SEM_SUCESSOR'::text
        END AS status_evolucao
   FROM ((public.produtos p
     LEFT JOIN public.produtos predecessor ON ((p.produto_predecessor_id = predecessor.id)))
     LEFT JOIN public.produtos sucessor ON ((sucessor.produto_predecessor_id = p.id)));


ALTER VIEW public.vw_produtos_evolucao OWNER TO postgres;

--
-- Name: VIEW vw_produtos_evolucao; Type: COMMENT; Schema: public; Owner: postgres
--

COMMENT ON VIEW public.vw_produtos_evolucao IS 'View que mostra a cadeia de evolu????o de produtos (predecessor e sucessor)';


--
-- Name: vw_produtos_listagem; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vw_produtos_listagem AS
 SELECT p.id,
    p.user_id,
    p.nome,
    p.is_parent,
    p.is_sellable,
    NULL::integer AS parent_id,
    NULL::integer AS variation_id,
    'PRODUTO'::text AS tipo
   FROM public.produtos p
UNION ALL
 SELECT pv.id,
    NULL::integer AS user_id,
    pv.name AS nome,
    false AS is_parent,
    true AS is_sellable,
    pv.product_parent_id AS parent_id,
    pv.id AS variation_id,
    'VARIACAO'::text AS tipo
   FROM public.product_variations pv;


ALTER VIEW public.vw_produtos_listagem OWNER TO postgres;

